import React from "react";

const JobInsights = ({ insights }) => {
  const { job_market, skills_in_demand, certifications } = insights;

  return (
    <div className="bg-white rounded-lg shadow-md p-6">
      <h2 className="text-2xl font-bold text-purple-600 mb-4">Job Insights</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* Job Market Overview */}
        <div className="bg-purple-50 rounded-lg p-4">
          <h3 className="text-lg font-semibold text-purple-800 mb-2">
            Job Market Overview
          </h3>
          <div className="space-y-2">
            <div className="flex justify-between items-center">
              <span className="text-gray-600">Growth Rate:</span>
              <span className="font-medium text-purple-800">
                {job_market.growth_rate}
              </span>
            </div>
            <div className="flex justify-between items-center">
              <span className="text-gray-600">Job Openings:</span>
              <span className="font-medium text-purple-800">
                {job_market.job_openings}
              </span>
            </div>
            <div className="flex justify-between items-center">
              <span className="text-gray-600">Market Demand:</span>
              <span className="font-medium text-purple-800">
                {job_market.market_demand}
              </span>
            </div>
          </div>
        </div>

        {/* Skills in Demand */}
        <div className="bg-purple-50 rounded-lg p-4">
          <h3 className="text-lg font-semibold text-purple-800 mb-2">
            In-Demand Skills
          </h3>
          <div className="flex flex-wrap gap-2">
            {skills_in_demand.map((skill, index) => (
              <span
                key={index}
                className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-purple-100 text-purple-800"
              >
                {skill}
              </span>
            ))}
          </div>
        </div>

        {/* Certifications */}
        <div className="bg-purple-50 rounded-lg p-4 md:col-span-2">
          <h3 className="text-lg font-semibold text-purple-800 mb-2">
            Recommended Certifications
          </h3>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            {certifications.map((cert, index) => (
              <div
                key={index}
                className="flex items-center space-x-2 bg-white rounded-lg p-3"
              >
                <div className="w-2 h-2 bg-purple-600 rounded-full"></div>
                <span className="text-gray-700">{cert}</span>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default JobInsights;
